/* eslint-disable no-unused-vars */
import { useState } from 'react';
import * as BookAPI from './BooksAPI.js';

const Output = ({result, setResult}) =>{
    
    

    const searchResult = () =>{
        return BookAPI.search('react', 2)
    };

    const assignResult = async () =>{
        const res = await searchResult(); 
        setResult(res)
        
    };
    assignResult();
}
export default Output;
